import 'package:flutter/material.dart';

class GridViewOfCity extends StatefulWidget {
  const GridViewOfCity({super.key});

  @override
  State<GridViewOfCity> createState() => _GridViewOfCityState();
}

class _GridViewOfCityState extends State<GridViewOfCity> {
  @override
  Widget build(BuildContext context) {
    List<String> city = [
      'Rajkot',
      'Morbi',
      'Ahemdabad',
      'Surat',
      'Amreli',
      'abc',
      'Rajkot',
      'Morbi',
      'Ahemdabad',
      'Surat',
      'Amreli',
      'abc'
    ];

    List<String> img = [
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
    ];
    return Scaffold(
      appBar: AppBar(
        title: Text("Grid View"),
      ),
      body: Padding(
        padding: const EdgeInsets.all(8.0),
        child: GridView.builder(
          itemCount: city.length,
          gridDelegate:
              SliverGridDelegateWithFixedCrossAxisCount(crossAxisCount: 3),
          itemBuilder: (context, index) {
            return Column(
              children: [
                GridTile(child: Text(city[index])),
                GridTile(child: Image.network(img[index]))
              ],
            );
          },
        ),
      ),
